// ==UserScript==
// @name         BattleMod
// @version      2.0
// @description  Most advanced hack for battledudes.io
// @author       Gradyruan
// @match        https://battledudes.io/
// @icon         data:image/png;base64,
// @grant        GM_setValue
// @grant        GM_getValue
// @run-at       document-start
// ==/UserScript==

window.battleMod = {
	version: "2.0",
	start: true,
	aim: true,
	aimMode: "manual",
	aimIgnoreObject: false,
	renderEnemyLine: true,
	renderEnemyCircle: true,
	renderObjectCircle: false,
	renderObjectPolygon: false,
	renderHealthBar: true,
	middleServer: null,
	hackZoomScale: 0.5,
	smoothFactor: 0.3,
	unusualDistanceDiff: 5,
	unusualAngleDiff: 20,
	maxFastestDistance: 50,
	aimRadius: 100,
	maxAimRadius: 200,
	maxPlayerHitCountPercent: 0.6,
	styles: {
		objAlpha: 0.35,
		objColor: 0xff0000,
		enemyLineSize: 3,
		enemyLineColor: {
			default: 0xff0000,
			collided: 0x808080,
			nearest: 0x00ff00
		},
		enemyCircleSize: 300,
		enemyCircleColor: {
			default: 0xff0000,
			nearest: 0x00ff00,
			alpha: 0.2
		},
		healthBar: {
			defaultColor: 0x00ff00,
			enemyColor: 0xff0000,
			backgroundColor: 0x3d3f42,
			width: 100,
			height: 18,
			yOffset: 70,
			pad: 4.5
		}
	},
	updateSettings(key) {
		GM_setValue(`battleMod${key}`, JSON.stringify(this[key]))
	}
}

let currentVersion = null
const storageVersion = GM_getValue(`battleModversion`)
if (storageVersion) {
	currentVersion = JSON.parse(storageVersion)
}

for (const key of Array.from([
	"start",
	"aim",
	"aimMode",
	"aimIgnoreObject",
	"renderEnemyCircle",
	"renderEnemyLine",
	"renderObjectCircle",
	"renderObjectPolygon",
	"renderHealthBar"
])) {
	const storage = GM_getValue(`battleMod${key}`)
	if (window.battleMod.version === currentVersion && storage) {
		window.battleMod[key] = JSON.parse(storage)
	} else {
		window.battleMod.updateSettings(key)
	}

	// Switching from storing data on the site to inside the userscript manager
	const removeStorage = localStorage.getItem(`battleMod${key}`)
	if (removeStorage) {
		localStorage.removeItem(`battleMod${key}`)
	}
}
window.battleMod.updateSettings("version")

